import './App.css';
import { Outlet,Link } from 'react-router-dom';
import {
  createBrowserRouter,
} from "react-router-dom";


const Nav = () =>{
    return (
       <div>
          <div>
             <Nav>
                <Link to="/" >Home</Link>
             </Nav>
          </div>
          <div>
              <Outlet/>
          </div>
       </div>
    );
}


const App = createBrowserRouter([
    {
      path: "/",
      element: <div>Hello Pretty{"<3"}</div>,
    },
  ]);

export default App;
